import React from 'react';
import './App.css';

// Main Page -- What is displayed across all pages
function App() {
    return (
        <div className="bg-wku-red min-h-screen flex flex-col items-center justify-center text-center">
            <h1 className="text-white text-5xl md:text-6xl font-bold mb-4 drop-shadow-lg">
                D.A.V.E.
            </h1>
            <p className="text-white text-lg md:text-2xl font-medium mb-8">
                <span className="font-semibold text-wkuYellow">D</span>ynamic <span className="font-semibold text-wkuYellow">A</span>lgorithm <span className="font-semibold text-wkuYellow">V</span>isualiz<span className="font-semibold text-wkuYellow">E</span>r
            </p>
            <div className="flex space-x-4">
                <button className="bg-black text-white px-6 py-3 rounded-md hover:bg-gray-800 transition-all">
                    Learn More
                </button>
                <button className="bg-white text-black px-6 py-3 rounded-md hover:bg-gray-200 transition-all">
                    About
                </button>
            </div>
        </div>
    );
}

export default App;
